    public List<SettleEventResponse> getSettleEvents(TransactionReceipt transactionReceipt) {
        List<EventValuesWithLog> valueList = extractEventParametersWithLog(SETTLE_EVENT, transactionReceipt);
        ArrayList<SettleEventResponse> responses = new ArrayList<SettleEventResponse>(valueList.size());
        for (EventValuesWithLog eventValues : valueList) {
            SettleEventResponse typedResponse = new SettleEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse.timestamp = (BigInteger) eventValues.getNonIndexedValues().get(0).getValue();
            typedResponse.targerOrderID = (String) eventValues.getNonIndexedValues().get(1).getValue();
            typedResponse.orderID = (String) eventValues.getNonIndexedValues().get(2).getValue();
            typedResponse.toAddress = (String) eventValues.getNonIndexedValues().get(3).getValue();
            typedResponse.amount = (BigInteger) eventValues.getNonIndexedValues().get(4).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

