    public static WasteManager deploy(Client client, CryptoKeyPair credential,
            String resouceCoinAddr, String _rewardAccount) throws ContractException {
        byte[] encodedConstructor = FunctionEncoder.encodeConstructor(Arrays.<Type>asList(new Address(resouceCoinAddr),
                new Address(_rewardAccount)));
        return deploy(WasteManager.class, client, credential, getBinary(client.getCryptoSuite()), getABI(), encodedConstructor, null);
    }

